import { AppBar, Container, Toolbar, Button } from "@mui/material";

const Navbar = () => {
  return (
    <>
        <AppBar>
            <Container>
                <Toolbar>
                    <Box></Box>
                    <Button variant="outlined">HOME</Button>
                </Toolbar>
            </Container>
        </AppBar>
      {/* <button>HOME</button>
      <button>CONSULTS</button>
      <button>PROFILE</button>
      <button>LOG OUT</button> */}
    </>
  );
};

export default Navbar;
